const images = {
	acme: 'data:image/jpeg;base64,',
	ibm: 'data:image/jpeg;base64,',
	female1: 'data:image/jpeg;base64,',
	female2: 'data:image/jpeg;base64,'
};

const demo_users = [
	{
		name: 'Acme',
		email: 'acme@example.com',
		attributes: {
			'tys_identifier': '549300VKX8CWI7ZGME90',
			'password': 'acmepw',
			portrait: images.acme
		}
	},
	{
		name: 'IBM',
		email: 'ibm@example.com',
		attributes: {
			'tys_identifier': '5493003BXKRGHQHRJV38',
			'password': 'ibmpw',
			portrait: images.ibm
		}
	}
];

window.makeid = function (length) {
	let result = '';
	const characters = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789';
	const charactersLength = characters.length;
	for (let i = 0; i < length; i++) {
		result += characters.charAt(Math.floor(Math.random() * charactersLength));
	}
	return result;
};

window.makelei = function (length) {
	let result = '';
	const characters = 'ABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789';
	const charactersLength = characters.length;
	for (let i = 0; i < length; i++) {
		result += characters.charAt(Math.floor(Math.random() * charactersLength));
	}
	return result;
};

const default_attributes = {
	'legal_name': '',
	'tys_identifier': window.makelei(16),
	'expiration_date': new Date(Date.now() + 1000 * 3600 * 24 * 365 * 8).toLocaleDateString(),
	'portrait': images.male1,
	'date_of_issue': new Date(Date.now()).toLocaleDateString(),
	'address_line_1': '2577 Raccoon Run',
	'address_line_2': '_',
	'city': 'Phoenix',
	'state': 'AZ',
	'zip_code': 98109,
	'country': 'United States',
};
window.default_attributes = default_attributes;

$(document).ready(() => {
	let html = '';
	for (const index in demo_users) {
		const user = demo_users[index];

		html += `<option value="${index}">${user.name}</option>`;
	}
	$('#userTemplate').html(html);

	$('#userTemplateForm').submit((event) => {
		event.preventDefault();

		const index = parseInt($('#userTemplate').val());
		const user_data = demo_users[index];
		console.log(`User data: ${JSON.stringify(user_data)}`);

		// assumes user_data.attributes.LEI
		$.ajax({
			url: `/leinumber/${user_data.attributes.LEI}`,
			method: 'GET',
			contentType: 'application/json'
		}).done((leiInfo) => {
			// copy any data from the leiInfo into the user_data, replacing
			//  the values for any common property since that data is the
			//  source of truth
			for (const attr_name in leiInfo) {
				user_data.attributes[attr_name] = leiInfo[attr_name];
			}
			populateFormFromAutoFill(default_attributes, user_data);
		}).fail((jqXHR, textStatus, errorThrown) => {
			console.debug(`lookupLEI failed: status: ${textStatus}, error: ${errorThrown}.  Populating with default data`);
			populateFormFromAutoFill(default_attributes, user_data);
		})

	});
});

function populateFormFromAutoFill(defAttributes, userData) {
	if (!defAttributes || !userData) {
		return;
	}
	for (const attr_name in defAttributes) {
		let value = defAttributes[attr_name];
		if (userData.attributes[attr_name]) value = userData.attributes[attr_name];
		$(`input[name="${attr_name}"]`).val(value);
	}
	$('#userPortraitPreview')[0].src = userData.attributes.portrait;
	$('#userPortraitPreview').removeClass('d-none');
	$('input[name="email"]').val(userData.email ? userData.email : '');
	$('input[name="confirm_password"]').val(userData.attributes.password ? userData.attributes.password : defAttributes.password);
	$('#autofillModal').modal('hide');
}
